import React from "react";
import * as ReactDOMClient from "react-dom/client";
import ReactDOM from "react-dom";
import App from "./app";
import "./css/main.css";

const app = ReactDOMClient.createRoot(document.getElementById("main"));
app.render(<App />);

const link = document.getElementById("test");

const Nam = () => {
  const val = 0;
  return (
    <div>
      <button>-1</button>
      <lable>{val}</lable>
      <button
        onClick={() => {
          val + 1;
        }}
      >
        +1
      </button>
    </div>
  );
};
ReactDOM.render(<Nam />, link);
